import { describe, it } from 'node:test';
import assert from 'node:assert';
import request from 'supertest';
import { envUrl, envUrlRest, testData, headers } from '../config/envConfig.js';
import { setTimeout } from 'node:timers/promises';
import { restartWithTimeout } from '../utils/restart.js';

describe('15. Custom Functions & components', () => {
	//Custom Functions & components Folder

	it('deploy_component github package', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({
				operation: 'deploy_component',
				project: 'deploy-test-gh',
				package: 'HarperDB/application-template',
			})
			.expect((r) => assert.ok(r.body.message == 'Successfully deployed: deploy-test-gh', r.text))
			.expect(200);
		await setTimeout(15000);
	});

	it('deploy_component using tar payload', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({
				operation: 'deploy_component',
				project: 'deploy-test-payload',
				payload:
					'',
			})
			.expect((r) => assert.ok(r.body.message == 'Successfully deployed: deploy-test-payload', r.text))
			.expect(200);
	});

	it('deploy_component using tar.gz payload', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({
				operation: 'deploy_component',
				project: 'deploy-test-payload-tar-gz',
				restart: true,
				payload:
					'',
			})
			.expect((r) => assert.ok(r.body.message == 'Successfully deployed: deploy-test-payload-tar-gz, restarting HarperDB', r.text))
			.expect(200);
		await setTimeout(30000);
	});

	it('call component tar payload', async () => {
		const response = await request(envUrlRest)
			.get('/GreetingTar')
			.set(headers)
			.expect((r) => assert.ok(r.body.greeting == 'Hello world from a test for deploying a component with tar payload', r.text))
			.expect(200);
	});

	it('call component tar.gz payload', async () => {
		const response = await request(envUrlRest)
			.get('/GreetingTarGz')
			.set(headers)
			.expect((r) => assert.ok(r.body.greeting == 'Hello world from deploy test payload tar gz', r.text))
			.expect(200);
	});

	it('set_component_file', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({
				operation: 'set_component_file',
				project: 'set-test',
				file: 'utils/test.js',
				payload: 'I am from inside a JS file',
				encoding: 'utf8',
			})
			.expect((r) => assert.ok(r.body.message == 'Successfully set component: utils/test.js', r.text))
			.expect(200);
	});

	it('get_component_file', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'get_component_file', project: 'set-test', file: 'utils/test.js', encoding: 'utf8' })
			.expect((r) => assert.ok(r.body.message == 'I am from inside a JS file', r.text))
			.expect(200);
	});

	it('add_component', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'add_component', project: 'add-test' })
			.expect((r) => assert.ok(r.body.message == 'Successfully added project: add-test', r.text))
			.expect(200);
	});

	it('package_component', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'package_component', project: 'add-test' })
			.expect((r) => assert.ok(r.body.hasOwnProperty('project'), r.text))
			.expect((r) => assert.ok(r.body.hasOwnProperty('payload'), r.text))
			.expect(200);
	});

	it('get_components', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'get_components' })
			.expect((r) => {
				assert.ok(r.body.entries.length == 5, r.text);
				let gh_found = false;
				let payload_found = false;
				let add_test_found = false;
				let set_test_found = false;
				let deploy_tar_gz_found = false;
				r.body.entries.forEach((e) => {
					let name = e.name;
					if (name === 'deploy-test-gh') gh_found = true;
					if (name === 'deploy-test-payload') payload_found = false;
					if (name === 'add-test') add_test_found = true;
					if (name === 'set-test') set_test_found = true;
					if (name === 'deploy-test-payload-tar-gz' && e.entries.length > 3) deploy_tar_gz_found = true;
				});
				assert.ok(gh_found && !payload_found && add_test_found && set_test_found && deploy_tar_gz_found, r.text);
			})
			.expect(200);
	});

	it('drop_component', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'drop_component', project: 'add-test' })
			.expect((r) => assert.ok(r.body.message == 'Successfully dropped: add-test', r.text))
			.expect(200);
	});

	it('get_components after drop', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'get_components' })
			.expect((r) => {
				assert.ok(r.body.entries.length == 4, r.text);
				let gh_found = false;
				let payload_found = false;
				let set_test_found = false;
				r.body.entries.forEach((e) => {
					let name = e.name;
					if (name === 'deploy-test-gh') gh_found = true;
					if (name === 'deploy-test-payload') payload_found = true;
					if (name === 'set-test') set_test_found = true;
				});
				assert.ok(gh_found && payload_found && set_test_found, r.text);
			})
			.expect(200);
	});

	it('drop_component set-test', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'drop_component', project: 'set-test' })
			.expect((r) => assert.ok(r.body.message == 'Successfully dropped: set-test', r.text))
			.expect(200);
	});

	it('add custom function project', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'add_custom_function_project', project: 'test_project' })
			.expect((r) => assert.ok(r.body.message == 'Successfully added project: test_project', r.text))
			.expect(200);
	});

	// it('restart service', async () => {
	// 	await restartWithTimeout(testData.restartTimeout);
	// });

	it('get custom function status', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'custom_functions_status' })
			.expect((r) => assert.ok(r.body.hasOwnProperty('port'), r.text))
			.expect((r) => assert.ok(r.body.hasOwnProperty('directory'), r.text))
			.expect(200);
	});

	it('call custom function', async () => {
		const response = await request(envUrlRest)
			.get('/Greeting')
			.set(headers)
			.expect((r) => assert.ok(r.body.hasOwnProperty('greeting'), r.text))
			.expect(200);
	});

	it('set custom function', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({
				operation: 'set_custom_function',
				project: 'test_project',
				type: 'routes',
				file: 'test2',
				function_content: 'hello world',
			})
			.expect((r) => assert.ok(r.body.message == 'Successfully updated custom function: test2.js', r.text))
			.expect(200);
	});

	it('get custom function', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'get_custom_function', project: 'test_project', type: 'routes', file: 'test2' })
			.expect((r) => assert.ok(r.body.message == 'hello world', r.text))
			.expect(200);
	});

	it('drop custom function', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'drop_custom_function', project: 'test_project', type: 'routes', file: 'test2' })
			.expect((r) => assert.ok(r.body.message == 'Successfully deleted custom function: test2.js', r.text))
			.expect(200);
	});

	it('confirm function was dropped', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'get_custom_function', project: 'test_project', type: 'routes', file: 'test2' })
			.expect((r) => assert.ok(r.body.error == 'File does not exist', r.text))
			.expect(400);
	});

	it('get custom functions', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'get_custom_functions' })
			.expect((r) => assert.ok(r.body.hasOwnProperty('test_project'), r.text))
			.expect(200);
	});

	it('drop custom functions project', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'drop_custom_function_project', project: 'test_project' })
			.expect((r) => assert.ok(r.body.message == 'Successfully deleted project: test_project', r.text))
			.expect(200);
	});

	it('confirm project was dropped', async () => {
		const expected_obj = {
			'deploy-test-gh': {
				routes: [],
				helpers: [],
			},
			'deploy-test-payload': {
				routes: [],
				helpers: [],
			},
			'deploy-test-payload-tar-gz': {
				routes: [],
				helpers: [],
			},
		};

		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'get_custom_functions' })
			.expect((r) => assert.deepEqual(r.body, expected_obj, r.text))
			.expect(200);
	});

	it('deploy custom function', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({
				operation: 'deploy_custom_function_project',
				project: 'test-deploy',
				bypass_config: true,
				payload:
					'',
			})
			.expect((r) => assert.ok(r.body.message == 'Successfully deployed: test-deploy', r.text))
			.expect(200);
		await setTimeout(22000);
	});

	it('confirm deploy worked', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'get_custom_functions' })
			.expect((r) => {
				assert.ok(r.body.hasOwnProperty('test-deploy'), r.text);
				assert.ok(r.body['test-deploy']['routes'] !== undefined, r.text);
				assert.ok(r.body['test-deploy']['routes'][0] == 'examples', r.text);
				assert.ok(r.body['test-deploy']['helpers'] !== undefined, r.text);
				assert.ok(r.body['test-deploy']['helpers'][0] == 'example', r.text);
			})
			.expect(200);
	});

	it('drop custom functions project deploy', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'drop_custom_function_project', project: 'test-deploy' })
			.expect((r) => assert.ok(r.body.message == 'Successfully deleted project: test-deploy', r.text))
			.expect(200);
	});

	it('drop deploy-test-payload', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'drop_component', project: 'deploy-test-payload' })
			.expect((r) => assert.ok(r.body.message == 'Successfully dropped: deploy-test-payload', r.text))
			.expect(200);
	});

	it('drop test-deploy from config', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'drop_component', project: 'test-deploy' })
			.expect((r) => assert.ok(r.body.message == 'Successfully dropped: test-deploy', r.text))
			.expect(200);
	});

	it('drop deploy-test-gh', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'drop_component', project: 'deploy-test-gh' })
			.expect((r) => assert.ok(r.body.message == 'Successfully dropped: deploy-test-gh', r.text))
			.expect(200);
	});

	it('drop deploy-test-payload-tar-gz', async () => {
		const response = await request(envUrl)
			.post('')
			.set(headers)
			.send({ operation: 'drop_component', project: 'deploy-test-payload-tar-gz' })
			.expect((r) => assert.ok(r.body.message == 'Successfully dropped: deploy-test-payload-tar-gz', r.text))
			.expect(200);
	});
});
